import React from 'react';


class BadgesList extends React.Component {
    render() {
        return (
            <ul className="list-unstyled">
            {this.props.badges.map(( badge ) => {
                return (
                    <div className="row">
                        <div className="col"></div>
                        <div className="col"></div>
                    </div>
                )
            })}
        </ul>
        );
    };
}

export default BadgesList;
